SELECT
    *
FROM
    salaries;

    
SELECT
    DEPARTMENT
    ,COUNT(1) TOTAL
FROM
    SALARIES
GROUP BY
    DEPARTMENT
ORDER BY
    DEPARTMENT;




SELECT
    T1.*
    ,T2.TOTAL
FROM
    SALARIES T1
LEFT JOIN
(
    SELECT
        DEPARTMENT
        ,COUNT(1) TOTAL
    FROM
        SALARIES
    GROUP BY
        DEPARTMENT
)T2
ON
    T1.DEPARTMENT = T2.DEPARTMENT
;

SELECT
    ID
    ,FIRST_NAME
    ,LAST_NAME
    ,DEPARTMENT
    ,COUNT(1) OVER(PARTITION BY DEPARTMENT) TOTAL_DEPARTMENT
FROM
    SALARIES
ORDER BY
    DEPARTMENT
;




SELECT
    ID
    ,FIRST_NAME
    ,LAST_NAME
    ,DEPARTMENT
    ,SALARY
    ,ROUND(AVG(SALARY) OVER(PARTITION BY DEPARTMENT),3) TOTAL_DEPARTMENT
FROM
    SALARIES
WHERE
    SALARY < 150
ORDER BY
    DEPARTMENT
;



create table salaries (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	department VARCHAR(50),
	gender VARCHAR(50),
	salary DECIMAL(6,2)
);
